import React from 'react';
import Navigation from './components/navigation';
import {
  createBrowserRouter,
  Router,
  RouterProvider,
} from "react-router-dom";




const router = createBrowserRouter(
  navLinks.map((link) => ({
    path: link.path,
    element: <div><Navigation/></div>,
  }))
);

function App() {
  return (
    <div>

      <RouterProvider router = {router}/>

    </div>
  );
}


export default App;
